import React from 'react';
import {useState} from 'react';
import PropTypes from "prop-types";
import './Animation.scss';

export default function Animation() {
    //let videos = ["xLYLzTDJH44", "xOpdRtrPk8M", "NirUBEVye3c"];
    const [displayVideo, setVideo] = useState();
    console.log(displayVideo);
    const videos = [{"name":"LeapFrog!",
                    "description": "blah",
                    "code": "xLYLzTDJH44"},
                    {"name":"The Good, The Dab, and The Ugly",
                    "description": "blah",
                    "code": "xOpdRtrPk8M"},
                    {"name":"TIMELESS",
                    "description": "blah",
                    "code": "NirUBEVye3c"}];
    return (

        <div class="animation-container">
            <div class="demo-reel-video">
                <div className="video-responsive">
                    <iframe width="600" height="338" 
                        src="https://www.youtube.com/embed/deERRRbdaOo" 
                        title="YouTube video player" 
                        frameborder="0" 
                        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
                        allowfullscreen/>
                </div>
            </div>
            <div class="demo-reel-description">
                <h1>Demo Reel</h1>
            </div>


            <div class="short-film-videos">
                <div class="radios">
                    {videos.map(result=>(
                        <div class="radio">
                        <input type="radio" value={result.name} name="shortFilms" onChange={(e)=>setVideo(result.code)}/>
                        <p>
                            <span class="video-name">
                                {result.name}
                            </span>
                            <span class="video-discription">
                                {result.description}
                            </span>
                        </p>
                        </div>

                    ))}
                </div>
                <div class="videos">
                    <iframe width="600" height="338" 
                        src={`https://www.youtube.com/embed/${displayVideo}`} 
                        title="YouTube video player" 
                        frameborder="0" 
                        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
                        allowfullscreen/>
                </div>
            </div>  


    </div>
    );
}
